@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@400;500;700&family=Poppins:wght@400;500;700&display=swap');
/* font-family: 'Noto Sans KR', sans-serif; */
/* font-family: 'Poppins', sans-serif; */

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    background-color: #f8f8f8;
    font-family: 'Poppins', sans-serif;
    &::-webkit-scrollbar {
        width: 12px;
    }
    &::-webkit-scrollbar-thumb {
        background: #fd8234; /* 스크롤바 색상 */
    }

    &::-webkit-scrollbar-track {
        background: rgba(0, 0, 0, 0.1); /*스크롤바 뒷 배경 색상*/
    }
    overflow-x: hidden;
}

li {
    list-style: none;
}

a {
    text-decoration: none;
    color: #222;
    display: block;
    width: 100%;
}

img {
    display: block;
    width: 100%;
}

.swiper-button-next:after,
.swiper-button-prev:after {
    color: #fff;
    opacity: 0.6;
}
.swiper-button-next:hover:after,
.swiper-button-prev:hover:after {
    opacity: 1;
    transition: all 0.3s;
}

.title {
    font: {
        size: 28px;
        weight: 500;
    }
    text-align: center;
    font-family: 'Poppins', sans-serif;
    letter-spacing: 1.5px;
}

.txt_box {
    position: absolute;
    width: 100%;
    height: 75px;
    bottom: 0;
    left: 0;
    background-color: rgba(255, 255, 255, 0.4);
    padding: 15px 15px;

    p {
        &:first-child {
            font-size: 12px;
            margin-bottom: 10px;
        }
        &:last-child {
            font: {
                size: 13px;
                weight: bold;
            }
        }
    }
}

@mixin size($width, $height) {
    width: $width;
    height: $height;
}

@mixin flex_style {
    display: flex;
    align-items: center;
}

@mixin line($height) {
    line-height: $height;
    text-align: center;
}
$color: #fd8234;

/* -------------header--------------- */
.header {
    position: absolute;
    top: 0;
    right: 0;
    left: 0;
    @include size(100%, 80px);
    background-color: transparent;
    border-bottom: 1px solid #eee;
    z-index: 999;

    font: {
        size: 15px;
    }

    .header_inner {
        @include size(100%, 80px);
        @include flex_style();
        padding: 0 25px;
        justify-content: space-between;

        ul {
            li {
                &:hover {
                    > a {
                        color: #fd8234;
                        transition: all 0.3s;
                    }
                }
            }
        }

        .header_left {
            position: relative;
            @include flex_style();

            .logo {
                width: 52px;
                margin-right: 35px;
            }
            .lnb {
                > ul {
                    @include flex_style();
                    height: 80px;

                    > li {
                        height: 100%;
                        line-height: 80px;
                    }

                    .menu {
                        &:hover {
                            .aside {
                                left: 0;
                                transition: all 0.3s;
                            }
                        }
                        .aside {
                            position: fixed;
                            top: 80px;
                            left: -435px;
                            background-color: #fff;
                            height: calc(100vh - 80px);
                            color: #261c13;
                            font-family: 'Noto Sans KR', sans-serif;
                            z-index: 1000;
                            font: {
                                size: 14px;
                                weight: 300;
                            }

                            li {
                                &:hover {
                                    background-color: #efe8da;
                                    transition: all 0.3s;
                                }
                            }

                            .top_lnb {
                                height: 60px;
                                line-height: 60px;

                                ul {
                                    @include flex_style();

                                    li {
                                        width: 50%;
                                        padding: 0 20px;
                                        border-bottom: 1px solid #eee;
                                        margin-right: 0;
                                    }
                                }
                            }
                            .bottom_lnb {
                                li {
                                    height: 60px;
                                    width: 435px;
                                    padding: 0 20px;
                                    line-height: 60px;
                                    margin-right: 0;
                                    border-bottom: 1px solid #eee;
                                }
                            }
                        }
                    }

                    .brand_story {
                        position: relative;

                        &:hover {
                            .story_box {
                                visibility: visible;
                                opacity: 1;
                                transition: all 0.3s;
                            }
                        }

                        .story_box {
                            visibility: hidden;
                            opacity: 0;

                            ul {
                                position: fixed;
                                top: 80px;
                                left: 0;
                                @include size(100%, 60px);
                                @include line(60px);
                                display: flex;
                                background-color: #fff;
                                border-bottom: 1px solid #eee;
                                padding-left: 184px;
                            }
                        }
                    }

                    li {
                        margin-right: 35px;

                        &:last-child {
                            margin-right: 0;
                        }
                    }
                }
            }
        }

        .header_right {
            @include flex_style();

            ul {
                @include flex_style();

                li {
                    margin-right: 35px;

                    &:last-child {
                        margin-right: 0;
                    }

                    &.search_icon {
                        position: relative;
                        @include size(160px, 25px);
                        border-radius: 20px;
                        background-color: $color;

                        input {
                            background-color: $color;
                            border: none;
                            outline: none;
                            @include size(130px, 25px);
                            border-radius: 20px;
                            padding-left: 15px;
                        }

                        button {
                            position: absolute;
                            top: 5px;
                            right: 7px;
                            background-color: $color;
                            border: none;
                            outline: none;
                            border-radius: 20px;
                            cursor: pointer;
                            color: #fff;
                        }
                    }
                }
            }
        }
    }
    &.is-sticky {
        position: fixed;
        box-shadow: 0 5px 16px rgba(0, 0, 0, 0.1);
        backdrop-filter: blur(10px);
        animation: slideDown 0.35s ease-out;
    }
}
@keyframes slideDown {
    from {
        transform: translateY(-100%);
    }
    to {
        transform: translateY(0);
    }
}

/* -------------path--------------- */
.path {
    margin: 120px 50px 15px;

    ul {
        display: flex;

        li {
            font-size: 14px;

            a {
                display: inline;
            }
            &::after {
                content: '\f0da';
                font-family: 'Font Awesome 5 Free';
                font-weight: 900;
                padding: 0 10px;
            }
            &:last-child::after {
                display: none;
            }
        }
    }
}

/* -------------category--------------- */
.category {
    @include size(100%, 180px);
    background-color: #efe8da;
    text-align: center;
    font-family: 'Noto Sans KR', sans-serif;

    .category_box {
        padding: 30px 200px;

        ul {
            display: flex;
            justify-content: space-between;

            li {
                .img_wrap {
                    width: 100px;
                    border-radius: 50%;
                    background-color: #fff;
                    text-align: center;

                    img {
                        width: 100px;
                        border-radius: 50%;
                        padding: 10px;
                    }

                    &:hover {
                        box-shadow: 0 5px 14px #fd813438;
                        transition: all 0.3s;
                    }
                }

                &:first-child {
                    a {
                        line-height: 100px;

                        font: {
                            size: 30px;
                            weight: bold;
                        }
                    }
                }

                p {
                    padding-top: 10px;
                    font: {
                        size: 14px;
                        weight: 300;
                    }
                }
            }
        }
    }
}
/* -------------product_list--------------- */
.product {
    width: 1269px;
    margin: 0 auto;

    h1 {
        padding: 30px 0;
    }

    .product_list {
        display: flex;
        justify-content: space-between;
        flex-wrap: wrap;

        .best_box {
            @include size(275px, 355px);
            margin-bottom: 30px;

            .products {
                @include size(275px, 275px);
                .pro_txt {
                    height: 80px;
                    padding: 10px;
                    background-color: rgba(255, 255, 255, 0.6);
                    p {
                        &:nth-child(1) {
                            font-size: 12px;
                        }
                        &:nth-child(2) {
                            font-size: 13px;
                            font-weight: bold;
                        }
                    }
                }
            }
        }
    }
    .paging {
        display: flex;
        align-items: center;
        justify-content: center;
        cursor: pointer;
        margin-bottom: 20px;

        i {
            padding: 0 2px;
        }
        .pages {
            padding: 0 5px;
            span {
                padding: 0 5px;

                &.active {
                    color: $color;
                }
            }
        }
    }
}
/* -------------footer--------------- */
.footer {
    @include size(100%, 550px);
    background-color: #261c13;
    color: #fff;

    .footer_box {
        width: 1420px;
        margin: 0 auto;
        padding-top: 60px;

        .top_footer {
            display: flex;
            justify-content: space-between;

            .cs_center {
                p {
                    &:nth-child(1) {
                        font: {
                            size: 20px;
                            weight: bold;
                        }
                    }
                    &:nth-child(2) {
                        font: {
                            size: 30px;
                            weight: bold;
                        }
                        color: $color;
                    }
                    &:nth-child(3) {
                        font: {
                            size: 18px;
                            weight: 300;
                        }
                    }
                }
            }

            .insta_logo {
                i {
                    color: #fff;
                    font-size: 40px;
                }
            }
        }

        .bottom_footer {
            display: flex;
            justify-content: space-between;

            .left_logo {
                padding-top: 150px;
                img {
                    @include size(116px, 135px);
                }
                p {
                    margin-top: 20px;
                }
            }

            .right_info {
                > ul {
                    display: flex;
                    gap: 55px;

                    > li {
                        font-weight: 700;

                        ul {
                            margin-top: 15px;

                            li {
                                padding: 5px 0;
                                font-weight: 300;
                                a {
                                    color: #fff;
                                }
                            }
                        }
                    }
                }

                .right_txt {
                    padding-top: 40px;
                    font-size: 14px;

                    .info_up {
                        display: none;
                    }
                    i {
                        cursor: pointer;
                        padding-left: 5px;
                    }
                }
                .text_box {
                    position: absolute;
                    font-size: 14px;
                    margin-top: 15px;
                    padding: 10px;
                    border-radius: 5px;
                    background-color: $color;
                    opacity: 0;

                    a {
                        display: inline;
                        color: #fff;
                    }
                    &.ani {
                        animation: slideDown 0.35s ease-out;
                        opacity: 1;
                    }
                }
            }
        }
    }
}

/* -------------top_btn--------------- */
.buttons {
    position: fixed;
    bottom: 5%;
    right: 5%;
    cursor: pointer;
    text-align: center;
    z-index: 50;

    > div {
        @include size(45px, 45px);
        border-radius: 50%;
        background-color: #222;
        padding: 5px;
        color: #efe8da;
        font-size: 25px;

        &.history_btn {
            margin-bottom: 10px;
        }

        &:hover {
            background-color: $color;
            transition: all 0.3s;
        }
    }
}
